430\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%B3%D0%B5%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\">\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0430<\/a> \u0432 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864_%D0%B3%D0%BE%D0%B4\" title=\"1864 \u0433\u043e\u0434\">1864<\/a>&#160;\u2014 \u0412\u0437\u0440\u044b\u0432 \u0441\u043c\u0435\u043b \u0441 \u043b\u0438\u0446\u0430 \u0437\u0435\u043c\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\">\u0441\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0441\u043a\u0443\u044e<\/a> \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%8C,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4_%D0%91%D0%B5%D1%80%D0%BD%D1%85%D0%B0%D1%80%D0%B4\" class=\"mw-redirect\" title=\"\u041d\u043e\u0431\u0435\u043b\u044c, \u0410\u043b\u044c\u0444\u0440\u0435\u0434 \u0411\u0435\u0440\u043d\u0445\u0430\u0440\u0434\">\u0410\u043b\u044c\u0444\u0440\u0435\u0434\u0430 \u041d\u043e\u0431\u0435\u043b\u044f<\/a>, \u0433\u0434\u0435 \u043e\u043d \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u043e\u0442\u0446\u043e\u043c \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043b \u0441\u0432\u043e\u0438 \u043e\u043f\u044b\u0442\u044b \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D1%82%D1%80%D0%BE%D0%B3%D0%BB%D0%B8%D1%86%D0%B5%D1%80%D0%B8%D0%BD\" title=\"\u041d\u0438\u0442\u0440\u043e\u0433\u043b\u0438\u0446\u0435\u0440\u0438\u043d\">\u043d\u0438\u0442\u0440\u043e\u0433\u043b\u0438\u0446\u0435\u0440\u0438\u043d\u043e\u043c<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 5 \u043f\u043e\u043c\u043e\u0449\u043d\u0438\u043a\u043e\u0432 \u0438 \u043c\u043b\u0430\u0434\u0448\u0438\u0439 \u0431\u0440\u0430\u0442 \u0410\u043b\u044c\u0444\u0440\u0435\u0434\u0430&#160;\u2014 \u042d\u043c\u0438\u043b\u044c. \u041e\u0442\u0446\u0430 \u043e\u0442 \u0433\u043e\u0440\u044f \u0440\u0430\u0437\u0431\u0438\u043b \u0443\u0434\u0430\u0440. \u041d\u043e \u0410\u043b\u044c\u0444\u0440\u0435\u0434 \u0441\u0432\u043e\u0438 \u043e\u043f\u044b\u0442\u044b \u043d\u0435 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b, \u0438 \u0447\u0435\u0440\u0435\u0437 \u0442\u0440\u0438 \u0433\u043e\u0434\u0430 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043f\u0430\u0442\u0435\u043d\u0442 \u043d\u0430 \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BD%D0%B0%D0%BC%D0%B8%D1%82\" title=\"\u0414\u0438\u043d\u0430\u043c\u0438\u0442\">\u0434\u0438\u043d\u0430\u043c\u0438\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D0%B5%D0%B2%D0%B0\" title=\"\u0416\u0435\u043d\u0435\u0432\u0430\">\u0416\u0435\u043d\u0435\u0432\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0441\u044f I \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0438\u043d\u0442\u0435\u0440\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\">\u041f\u0435\u0440\u0432\u043e\u0433\u043e \u0438\u043d\u0442\u0435\u0440\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1875_%D0%B3%D0%BE%D0%B4\" title=\"1875 \u0433\u043e\u0434\">1875<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0432 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043e\u0431\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0435 \u043f\u0440\u0438 \u043e\u0433\u0440\u043e\u043c\u043d\u043e\u043c \u0441\u043a\u043e\u043f\u043b\u0435\u043d\u0438\u0438 \u043d\u0430\u0440\u043e\u0434\u0430, \u0432 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u0437\u0430\u043a\u043b\u0430\u0434\u043a\u0430 \u0437\u0434\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u043c\u0443\u0437\u0435\u0439\">\u0418\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043c\u0443\u0437\u0435\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1880_%D0%B3%D0%BE%D0%B4\" title=\"1880 \u0433\u043e\u0434\">1880<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0438\u043d\u0436\u0435\u043d\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%80%D0%BE%D1%86%D0%BA%D0%B8%D0%B9,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%90%D0%BF%D0%BE%D0%BB%D0%BB%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0438\u0440\u043e\u0446\u043a\u0438\u0439, \u0424\u0451\u0434\u043e\u0440 \u0410\u043f\u043e\u043b\u043b\u043e\u043d\u043e\u0432\u0438\u0447\">\u0424\u0451\u0434\u043e\u0440 \u041f\u0438\u0440\u043e\u0446\u043a\u0438\u0439<\/a> \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 (\u043f\u043e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u043c \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u043c&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 ) \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B0%D0%BC%D0%B2%D0%B0%D0%B9\" title=\"\u0422\u0440\u0430\u043c\u0432\u0430\u0439\">\u0442\u0440\u0430\u043c\u0432\u0430\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u0432 \u0410\u043d\u0433\u043b\u0438\u0438 \u043d\u0430\u0447\u0430\u043b \u0440\u0430\u0431\u043e\u0442\u0443 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043a\u043e\u043d\u0441\u0435\u0440\u0432\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a><ul><li>\u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432\u0437\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2\" title=\"\u041b\u044c\u0432\u043e\u0432\">\u041b\u044c\u0432\u043e\u0432<\/a>.<\/li><li>\u041a\u0430\u0440\u0434\u0438\u043d\u0430\u043b \u0414\u0436\u0438\u0430\u043a\u043e\u043c\u043e \u0434\u0435\u043b\u043b\u0430 \u041a\u044c\u0435\u0437\u0430 \u0438\u0437\u0431\u0440\u0430\u043d \u041f\u0430\u043f\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B5%D0%B4%D0%B8%D0%BA%D1%82_XV_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u0411\u0435\u043d\u0435\u0434\u0438\u043a\u0442 XV (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u0411\u0435\u043d\u0435\u0434\u0438\u043a\u0442\u043e\u043c XV<\/a>.<\/li><li>\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u043a\u0430 \u041c\u044d\u0440\u0438 \u0424\u0435\u043b\u043f\u0441 \u0414\u0436\u0435\u043a\u043e\u0431\u0441 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;Mary Phelps Jacobs) \u0438\u0437\u043e\u0431\u0440\u0435\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%8E%D1%81%D1%82%D0%B3%D0%B0%D0%BB%D1%8C%D1%82%D0%B5%D1%80\" title=\"\u0411\u044e\u0441\u0442\u0433\u0430\u043b\u044c\u0442\u0435\u0440\">\u0431\u044e\u0441\u0442\u0433\u0430\u043b\u044c\u0442\u0435\u0440<\/a>. \u00ab\u041e\u043f\u044b\u0442\u043d\u044b\u0439\u00bb \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u043e\u043d\u0430 \u0441\u043c\u0430\u0441\u0442\u0435\u0440\u0438\u043b\u0430 \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u0441\u043b\u0443\u0436\u0430\u043d\u043a\u0438 \u0438\u0437 \u043d\u043e\u0441\u043e\u0432\u044b\u0445 \u043f\u043b\u0430\u0442\u043a\u043e\u0432 \u0438 \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b\u0430 \u0441\u0432\u043e\u0451 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915 \u0433\u043e\u0434\u0443<\/a>. \u0412\u0441\u0435 \u0436\u0435\u043d\u0449\u0438\u043d\u044b \u0432 \u044d\u0442\u043e \u0432\u0440\u0435\u043c\u044f \u043d\u043e\u0441\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D1%81%D0%B5%D1%82\" title=\"\u041a\u043e\u0440\u0441\u0435\u0442\">\u043a\u043e\u0440\u0441\u0435\u0442\u044b<\/a>, \u0438 \u043f\u043e\u043d\u0430\u0447\u0430\u043b\u0443 \u00ab\u0431\u0435\u0441\u0441\u043f\u0438\u043d\u043d\u044b\u0439 \u043b\u0438\u0444\u0447\u0438\u043a\u00bb \u0443\u0441\u043f\u0435\u0445\u0430 \u043d\u0435 \u0438\u043c\u0435\u043b. \u041d\u043e \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u0438\u043c\u0447\u0438\u0432\u044b\u0439 \u043c\u0443\u0436 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u044b, \u0441\u043b\u0443\u0436\u0438\u0432\u0448\u0438\u0439 \u0432 \u043a\u043e\u0440\u0441\u0435\u0442\u043d\u043e\u0439 \u0444\u0438\u0440\u043c\u0435, \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u0441\u0432\u043e\u0438\u043c \u0445\u043e\u0437\u044f\u0435\u0432\u0430\u043c \u043d\u043e\u0432\u0438\u043d\u043a\u0443, \u0438 \u0442\u0435 \u043e\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u043f\u0440\u043e\u0432\u0438\u0434\u0446\u0430\u043c\u0438, \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u044f \u0443 \u041c\u044d\u0440\u0438 \u043f\u0430\u0442\u0435\u043d\u0442 \u0437\u0430 15 \u0442\u044b\u0441. \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432. \u0418\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e, \u0447\u0442\u043e \u041c\u044d\u0440\u0438&#160;\u2014 \u043f\u0440\u044f\u043c\u043e\u0439 \u043f\u043e\u0442\u043e\u043c\u043e\u043a \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4\" title=\"\u041f\u0430\u0440\u043e\u0445\u043e\u0434\">\u043f\u0430\u0440\u043e\u0445\u043e\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%83%D0%BB%D1%82%D0%BE%D0%BD,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u0424\u0443\u043b\u0442\u043e\u043d, \u0420\u043e\u0431\u0435\u0440\u0442\">\u0420\u043e\u0431\u0435\u0440\u0442\u0430 \u0424\u0443\u043b\u0442\u043e\u043d\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#160;\u2014 \u0412 \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 \u0441\u043e\u0437\u0434\u0430\u043d \u043f\u043e\u043b\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%B5%D1%87%D0%B5%D0%B2%D1%8B%D0%B5_%D1%81%D1%82%D1%80%D0%B5%D0%BB%D1%8C%D1%86%D1%8B\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0435 \u0441\u0435\u0447\u0435\u0432\u044b\u0435 \u0441\u0442\u0440\u0435\u043b\u044c\u0446\u044b\">\u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0445 \u0441\u0435\u0447\u0435\u0432\u044b\u0445 \u0441\u0442\u0440\u0435\u043b\u044c\u0446\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u043a\u043e\u043c\u0435\u043d\u0434\u0430\u043d\u0442\u043e\u043c \u041a\u0440\u0435\u043c\u043b\u044f \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D0%BD%D0%BD%D0%B8_%D0%9A%D0%B0%D0%BF%D0%BB%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u0424\u0430\u043d\u043d\u0438 \u041a\u0430\u043f\u043b\u0430\u043d\">\u0424\u0430\u043d\u043d\u0438 \u041a\u0430\u043f\u043b\u0430\u043d<\/a>, \u043e\u0431\u0432\u0438\u043d\u0451\u043d\u043d\u0430\u044f \u0432 \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u041b\u0435\u043d\u0438\u043d\">\u041b\u0435\u043d\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a><ul><li>\u0421\u043e\u0437\u0434\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u0430\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e\u0439 \u0430\u0432\u0438\u0430\u043f\u043e\u0447\u0442\u044b.<\/li><li>\u0420\u0430\u0437\u044b\u0433\u0440\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%BD%D0%B4%D0%B1%D0%BE%D0%BB\" title=\"\u0413\u0430\u043d\u0434\u0431\u043e\u043b\">\u0433\u0430\u043d\u0434\u0431\u043e\u043b\u0443<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0418\u043d\u0434\u0443\u0441\u0442\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u043d\u0434\u0435\u043a\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Dow_Jones\" class=\"mw-redirect\" title=\"Dow Jones\">Dow Jones<\/a> \u0437\u0430\u043a\u0440\u044b\u0442 \u043d\u0430 381.17, \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u043c \u0443\u0440\u043e\u0432\u043d\u0435 \u043f\u0435\u0440\u0435\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%80%D0%B6%D0%B5%D0%B2%D0%BE%D0%B9_%D0%BA%D1%80%D0%B0%D1%85_1929_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0411\u0438\u0440\u0436\u0435\u0432\u043e\u0439 \u043a\u0440\u0430\u0445 1929 \u0433\u043e\u0434\u0430\">\u043e\u0431\u0432\u0430\u043b\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%BB_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%9C%D0%BE%D1%81%D0%BA