.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u0437\u0430\u0435\u0437\u0434\u0430\u043c\u0438 \u043d\u0430 \u0442\u0440\u0430\u0441\u0441\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%86%D0%B0\" title=\"\u041c\u043e\u043d\u0446\u0430\">\u041c\u043e\u043d\u0446\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044f<\/a>) \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442 \u043c\u0438\u0440\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D1%80%D0%BC%D1%83%D0%BB%D0%B0-1\" title=\"\u0424\u043e\u0440\u043c\u0443\u043b\u0430-1\">\u0424\u043e\u0440\u043c\u0443\u043b\u0430-1<\/a>\u00bb. \u0427\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u043c \u0441\u0442\u0430\u043b 43-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D1%80%D0%B8%D0%BD%D0%B0,_%D0%9D%D0%B8%D0%BD%D0%BE\" class=\"mw-redirect\" title=\"\u0424\u0430\u0440\u0438\u043d\u0430, \u041d\u0438\u043d\u043e\">\u041d\u0438\u043d\u043e \u0424\u0430\u0440\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a>&#160;\u2014 <a href=\"https:\/\